import React from 'react';

class LeaderboardListItem extends React.Component{
    render(){
        const { userName, count} = this.props;
        return <li className="list-group-item-primary d-flex justify-content-between align-items-center">
            {userName}
        <span className="badge badge-primary badge-pill">{count}</span>
        </li>
    }
}
export default LeaderboardListItem
